import React from 'react';
import logo from './logo.svg';
import './App.css';

import Travel from "./TravelComponent";

class App extends Travel {
  render() {
    return (
        <div className="App">
          <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <h1 className="App-title">Travel Destinations</h1>
          </header>
          <Travel
              destination="Barcelona"
              country = "Spain"
              photo="https://cdn.pixabay.com/photo/2014/08/26/14/11/panorama-427997_960_720.jpg"
              distance="Road distance 2,760.8 km, 3h 20 min Flight"
        />
          <Travel
              quote="Me fail English? That's unpossible"
              character="Ralph Wiggum"
              image="https://cdn.glitch.com/3c3ffadc-3406-4440-bb95-d40ec8fcde72%2FRalphWiggum.png?1497567511523"
          />
        </div>
    );
  }
}

export default App;
